import {useDispatch, useSelector} from "react-redux";
import { LOGIN_STATE } from "../redux/stateConstants";
import { logout, addPostPage } from "../redux/actions";
import { VIEW_POST } from "../redux/actionConstants";

const Header = () => {

    const dispatch = useDispatch();
    const loginState = useSelector(state => state.loginState);
    const viewState = useSelector(state => state.viewState);


    return (
        <nav className="navbar navbar-dark bg-dark header-fixer">
            <div className="container-fluid">
                <a className="navbar-brand" href="#">InstaChat</a>
                {
                    loginState === LOGIN_STATE.LOGGED_IN && viewState === VIEW_POST &&  
                    <button className="btn button-color btn-primary " onClick={() => dispatch(addPostPage())}>
                    Add Post
                   </button> 
                }
                {
                loginState === LOGIN_STATE.LOGGED_IN &&
                <button className="btn button-color btn-primary float-end" onClick={() => dispatch(logout())}>
                Log Out
               </button> 
                }


            </div>
        </nav>
    )
}

export default Header
